import Layout from '../components/Layout';



const Login = () =>  {

   return  (
    <Layout>
        <div>
           <input type="text" name="username" value="" placeholder="username" /><br/>
           <input type="password" name="password" value="" placeholder="password" />
           <button>Login</button>

           <Dashboard />
        </div>
    </Layout>

    );
};






const Dashboard = () =>  {

    return  (
  
         <div>

            <button>Logout</button>


         </div>
  
 
     );
 };
 


export default Login;
